import React from 'react';

function NotFound(props) {
    return (
        <div className='container'>
            <div className='d-flex justify-content-center align-items-center vh-100'>
                <div className="display-6">
                    404
                </div>
                <div className="display-6">
                    Page Not Found
                </div>
            </div>
        </div>
    );
}

export default NotFound;
